import strings from "../localization";

const Gender = {
  Male: 1,
  Female: 2,
};

export default Gender;

export function getGenderList() {
  return [
    {
      name: strings.gender.male,
      value: Gender.Male,
    },
    {
      name: strings.gender.female,
      value: Gender.Female,
    },
  ];
}

export function getGenderString(gender) {
  switch (gender) {
    case Month.January:
      return strings.months.january;
    case Month.February:
      return strings.months.february;
    case Month.March:
      return strings.months.march;
    case Month.April:
      return strings.months.april;
    case Month.May:
      return strings.months.may;
    case Month.Jun:
      return strings.months.jun;
    case Month.July:
      return strings.months.july;
    case Month.August:
      return strings.months.august;
    case Month.September:
      return strings.months.september;
    case Month.October:
      return strings.months.october;
    case Month.November:
      return strings.months.november;
    case Month.December:
      return strings.months.december;
  }
}
